function Queue(){var n=[];this.getlen=function(){return n.length},this.insert=function(t){n.push(t)},this.remove=function(){return 0===n.length?!1:n.shift()},this.peek=function(){return 0===n.length?!1:n[0]},this.swap=function(t,e){var i=n[t];n[t]=n[e],n[e]=i},this.check=function(){console.log(JSON.stringify(n))}}
